import React from 'react'
import axios from 'axios'

const Item = ({link}) => {
  const watch = () => {
    axios.get(link)
  }

  return (
    <div className="row-item" onclick={watch}>
      <img src="kny.jpg" alt="poster"/>
    </div>
  )
}

export default Item
